const userRoutes = [
    {
        path: '/register',
        name: 'register',
        component: () => import('@/views/register/Register.vue'),
    },
    {
        path: '/login',
        name: 'login',
        component: () => import('@/views/login/Login.vue'),
    },
    {
        path: 'profile',
        name: 'profile',
        component: () => import('@/views/profile/profile'),
    },

];

export default userRoutes;
